import React, { useState } from 'react';
import { useNavigate } from 'react-router-dom';
import axios from 'axios';

const CreateOrder = () => {
  const navigate = useNavigate();
  const [items, setItems] = useState([{ name: '', quantity: 1, price: 0 }]);
  const [deliveryAddress, setDeliveryAddress] = useState('');
  const [paymentMethod, setPaymentMethod] = useState('cash');
  const [totalAmount, setTotalAmount] = useState(0);
  const [error, setError] = useState('');
  const [isSubmitting, setIsSubmitting] = useState(false);

  const handleItemChange = (index, field, value) => {
    const updatedItems = [...items];
    updatedItems[index][field] = field === 'quantity' || field === 'price' ? parseFloat(value) : value;
    setItems(updatedItems);
    setTotalAmount(calculateTotal(updatedItems));
  };

  const addItem = () => {
    setItems([...items, { name: '', quantity: 1, price: 0 }]);
  };

  const calculateTotal = (items) => {
    return items.reduce((sum, item) => sum + item.quantity * item.price, 0);
  };

  const handleSubmit = async (e) => {
    e.preventDefault();
    setError('');
    setIsSubmitting(true);

    const shopOwnerId = localStorage.getItem('shopOwnerId');

    if (!shopOwnerId) {
      setError('Shop owner ID not found. Please log in again.');
      setIsSubmitting(false);
      return;
    }

    try {
      const response = await axios.post(
        'http://localhost:3001/orders',
        {
          customerId: shopOwnerId,
          items,
          deliveryAddress,
          paymentMethod,
          totalAmount
        },
        {
          headers: { 'Content-Type': 'application/json' },
          withCredentials: true
        }
      );

      if (response.data.success) {
        navigate('/shop-owner-dashboard');
      } else {
        setError(response.data.message || 'Failed to create order');
      }
    } catch (err) {
      console.error('Create Order Error:', err);
      setError(err.response?.data?.message || 'An error occurred while creating the order.');
    } finally {
      setIsSubmitting(false);
    }
  };

  return (
    <div style={{ padding: '20px', fontFamily: 'Arial' }}>
      <h2>Create Order</h2>
      {error && <p style={{ color: 'red' }}>{error}</p>}
      <form onSubmit={handleSubmit}>
        {items.map((item, index) => (
          <div key={index} style={{ marginBottom: '10px' }}>
            <input
              type="text"
              placeholder="Item name"
              value={item.name}
              onChange={(e) => handleItemChange(index, 'name', e.target.value)}
              required
            />
            <input
              type="number"
              placeholder="Quantity"
              value={item.quantity}
              min="1"
              onChange={(e) => handleItemChange(index, 'quantity', e.target.value)}
              required
            />
            <input
              type="number"
              placeholder="Price"
              value={item.price}
              min="0"
              step="0.01"
              onChange={(e) => handleItemChange(index, 'price', e.target.value)}
              required
            />
          </div>
        ))}
        <button type="button" onClick={addItem}>Add Item</button>
        <div style={{ marginTop: '20px' }}>
          <input
            type="text"
            placeholder="Delivery Address"
            value={deliveryAddress}
            onChange={(e) => setDeliveryAddress(e.target.value)}
            required
          />
        </div>
        <div style={{ marginTop: '10px' }}>
          <label>
            Payment Method:
            <select
              value={paymentMethod}
              onChange={(e) => setPaymentMethod(e.target.value)}
            >
              <option value="cash">Cash</option>
              <option value="card">Card</option>
            </select>
          </label>
        </div>
        <p>Total: ${totalAmount.toFixed(2)}</p>
        <button type="submit" disabled={isSubmitting}>
          {isSubmitting ? 'Submitting...' : 'Submit Order'}
        </button>
      </form>
    </div>
  );
};

export default CreateOrder;
